import axios from 'axios';
import { registerUrl } from '../config/config.json'

const signIn = async (data: any) => {
  try {

    const response = await axios.post(registerUrl, data);
    console.log(response.data);


  } catch (error) {
  }

}


const userRegister = async (data:any) => {
    try {

      const response = await axios.post(registerUrl,data);
      console.log(response.data);


    } catch (error) {
    }

  }
export {
  userRegister
}
